<script src="jquery-1.12.2.js"></script>
<button id="print">打印---相对盒子的位置</button>
<button id="print1">打印1---自身大小30个像素的位置</button>
<button id="print2">打印2---以自身大小为基准的相对像素位置</button>
<script>
    /**
     * 原形
     */

    var ninePic = document.getElementById("ninePic")
    var print = document.getElementById("print")
    var print1 = document.getElementById("print1")
    var print2 = document.getElementById("print2")
    print.onclick = function () {
        var str = positions.join("")
        console.log(str);
    }
    print1.onclick = function () {
        var str = positions1.join("")
        console.log(str);
    }

    var ninePicFlag = true
    var trs = ninePic.children
//    var tds=document.querySelectorAll(".td") 取所有的ts
//    console.log(tds);
    var num = 0
    var positions = ["盒子"]
    var positions1 = ['像素']

    for (var i = 0; i < trs.length; i++) {
        var tds = []
        tds[i] = trs[i].children;
        //取到的每一个td为 tds[tr索引][每个td索引]
        //i值表示的是行 j值表示列值
        for (var j = 0; j < tds[i].length; j++) {
            tds[i][j].ninePicFlag = true
            tds[i][j].index = num
            num++
            tds[i][j].onclick = function () {
                if (this.ninePicFlag) {
                    this.style.transform = "rotateY(180deg)";
                    this.style.transition = "1s";
                    this.style.backgroundColor = "#ff3040";
                    //flag = false;
                } else {
                    this.style.transform = "rotateY(0deg)";
                    this.style.transition = "1s";
                    this.style.backgroundColor = "skyblue";
                }
                this.ninePicFlag = !this.ninePicFlag
            }
        }
    }
    console.log(j);
    //打印前循环获取坐标值
    print2.onclick = function () {
        var positions2 = ['相对']
        var divs=ninePic.getElementsByTagName("div")
        for (var i = 0; i < divs.length; i++) {
            if (divs[i].ninePicFlag!=true) {
                var str2 = '{"top":'+ this.offsetTop / this.offsetHeight+', "left":'+ this.offsetLeft / this.offsetWidth+'},'
                positions2.push(str2)
            }
        }
        var strEnding = positions2.join("")
        console.log(strEnding);
    }

</script>
